// import "../assets/happy.png";

const Home = ({ headerContent, mainContent, footerContent }) => {
  return (
    <BaseComponent
      headerContent={
        <div>
          <h1 id="pageTitle">Välkommen till centrum för hemlösa hundar!!</h1>
        </div>}
      mainContent={
        <div>
        <h1>Main content!</h1>
        </div>
      }
    />
  );
};

export default Home;
